import React from 'react'

const BoxSisu = (props) => {
    props.box.map(item => {
        return (
            <div>
                key={item.id}
                style={{ backgroundColor: item.on ? "green" : "red" }}
                onClick={() => props.vajuta(item.id)}


            </div>
        );
    });
}

export default BoxSisu
